	public function get_flags( $str_flag ) {
		$flugs      = explode( ',', $str_flag );
		$flugs_tags = '';
		
		if ( is_array( $flugs ) ) {
			$icons_map = array(
				'en' => 'icon_fl_en',
				'es' => 'icon_fl_sp',
				'ua' => 'icon_fl_ua',
				'ru' => 'icon_fl_ru',
				'fr' => 'icon_fl_fr',
				'pt' => 'icon_fl_pt',
				'ar' => 'icon_fl_ar',
			);
			
			foreach ( $flugs as $flug ) {
				if ( isset( $icons_map[ $flug ] ) && method_exists( $this, $icons_map[ $flug ] ) ) {
					$flugs_tags .= $this->{$icons_map[ $flug ]}();
				}
			}
		}
		
		return $flugs_tags;
	}
	
